import React from "react";
import InvoiceRoot from "./invoiceRoot";

function InvoiceContiner(props) {
  return (
    <div
      style={{
        display: "grid",
        justifyContent: "center",
        gridTemplateColumns: "800px",
        height: "400px",
        overflow: "scroll",
      }}
    >
      <InvoiceRoot />
    </div>
  );
}

export default InvoiceContiner;
